import React from "react";
import styles from "./styles/Header.module.css";

import "./App.css";

function App() {
  return (
    <div className="app">
      <div className={styles.container}>
        <div>Logo</div>
        <div>
          <h1>Crave</h1>
        </div>
        <div className="float-right">
          <input />
          <button></button>
        </div>
      </div>
    </div>
  );
}

export default App;
